import './App.css';


class FruitsPage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            fruitsData: [],
            submitted: false
        }
    }



    render() {
        return (
            <div>
                <h1>Fruit Finder</h1>
            </div>
        )
    }
}

export default FruitsPage;
